🌩

🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷😎👏👏👏


Um resumo pra vc: 

1° Momento - Agradeceu pelos  58 milhões de Brasileiros que votam nele;

2° Momento - Movimentos Populares (Fruto de Indignação e de Injustiça) processo eleitoral;

3° Momento - As manifestações pacíficas, sempre serão bem vindas! … Aqui ele deu o “recado”! … daí do sofá e do conforto da sua casa e vá para as ruas, pois, só assim eu poderei tomar providências! … lembrando o 4° momento, lógico;

4° Momento - A forma de manifestação (métodos) não pode ser o mesmo utilizado pela esquerda, causando “prejuízo” para a população; (ex: Destruir patrimônio, Invadir propriedade e cerceamento do direito de ir e vir) … aí fica o alerta: Liberem imediatamente as rodovias!;

5° Momento: Formamos diversas lideranças pelo Brasil, nossos sonhos seguem mais vivos do que nunca; 

6° Momento - Superamos uma pandemia e as consequências de uma guerra x Ordem e Progresso;

7° Momento - Rotulado como “antidemocrático”, sempre jogando dentro das 4 linhas da Constituição, diferentemente dos acusadores; 

8° Momento - A robusta representação no Congresso demonstra a força dos valores da Direita: Deus, Pátria, Família e Liberdade;

9º Momento - Se sente honrado por ser o líder de milhões de Brasileiros que defendem: “liberdade” econômica, religiosa, de opinião, honestidade e as cores verde e amarela da bandeira do Brasil 🇧🇷;

10° Momento - Nunca falou em l controlar ou censurar” a mídia e as redes sociais e ainda, enquanto presidente e cidadão continuará cumprindo todos os mandamentos da CF;

Foram 10 Momentos e não 10 Mandamentos! 🇧🇷🙏
